import React from 'react';
import ReactDOM from 'react-dom';
import App from "./App";
//import 'bootstrap/dist/css/bootstrap.css';

ReactDOM.render(<App/>, document.getElementById("root"));

window.onload =() => {
    randomUserGenerator()
}
const randomUserGenerator = async () => {
    try {
        fetch('https://randomuser.me/api')
    .then((response) => {
        return response.json()
    }).then((data) => {
        console.log(data.results[0]);
        const firstName = data.results[0].name.first;
        const lastName = data.results[0].name.last;
        const email = data.results[0].email;
        const streetNumber = data.results[0].location.street.number;
        const streetName = data.results[0].location.street.name;
        const city = data.results[0].location.city;
        const state = data.results[0].location.state;
        const country = data.results[0].location.country;
        const postalCode = data.results[0].location.postcode;
        const dateOfBirth = data.results[0].dob.date;
        const phoneNumber = data.results[0].phone;
        const cellNumber = data.results[0].cell;
        const pictureLarge = data.results[0].picture.large;
        const pictureThumbnail = data.results[0].picture.thumbnail;
        console.log(firstName);
        console.log(lastName);
        console.log(email);
        console.log(streetNumber);
        console.log(streetName);
        console.log(city);
        console.log(state);
        console.log(country);
        console.log(postalCode);
        console.log(dateOfBirth);
        console.log(cellNumber);
        console.log(pictureLarge);
        console.log(pictureThumbnail);

    })
} catch (error) {
    console.log(error);
}


}
